import React from 'react';

/** 
 * TODO replace with api data
*/

export const projectList = [
    {
        icon: 'widgets',
        title: 'Valorant Go! Knife',
        subject: '3D Modelling',
        lastOpened: '20/07/2021',
        components:
            [
                {
                    type: 'largeTile',
                    content: 'In this project my aim was to use SolidWorks to create a replica of an item out of a game. In this case, I wanted to createa a model of the Valorant Go! Knife knife out of the FPS Valorant',
                },
                {
                    type: 'smallImg',
                    path: './img/test.png',
                    content: 'test',
                },
                {
                    type: 'mediumTile',
                    content: 'MEDIUM TILE',
                },
                {
                    type: 'smallTile',
                    content: 'SMALL TILE',
                },
                {
                    type: 'smallTile',
                    content: 'SMALL TILE',
                },
                {
                    type: 'smallTile',
                    content: 'SMALL TILE',
                },
                {
                    type: 'smallTile',
                    content: 'SMALL TILE',
                },
            ],
    },
    {
        icon: 'mic',
        title: 'Starting with Speechy',
        subject: 'Speechy',
        lastOpened: '15/07/2021',
        components: 
                [
                    {
                        type: 'largeTile',
                        content: 'In this project my aim was to create a python program wherein I could control simple processes on my computer using my voice.'
                    },
                ],

    },
    {
        icon: 'computer',
        title: 'This Website',
        subject: 'Web Development',
        lastOpened: '12/07/2021',
        components: 
                [
                    {
                        type: 'largeTile',
                        content: "This page is showing you how I made the website that you're looking at right now!"
                    },
                ],
    },
    
];
